import './Page.css';

function Page({ mainCookie}) {
  return (
    <div className="Page">
        <div className = "circle">
            {typeof mainCookie === 'string' ? (
            <p>{mainCookie}</p>
            ) : (
            <img src={mainCookie} alt="Circle Content" />
            )}

        </div>
    </div>
  );
}

export default Page;
